document.getElementById("update-statistics-button").onclick=function(t){!async function(){let t=await fetch("/data/data.json"),e=await t.json();console.log(e);const n=e.reduce(((t,e)=>t+e.f),0)/e.length,c=e.reduce(((t,e)=>t+e.x),0)/e.length,i=e.reduce(((t,e)=>t+e.v),0)/e.length,d=e.reduce(((t,e)=>t+e.q),0)/e.length;document.getElementById("statistic-1").innerHTML=(n-c)/3.14,document.getElementById("statistic-2").innerHTML=n+d/i,document.getElementById("statistic-3").innerHTML=n+c+d}()};